import React from 'react';
import { Link } from 'react-router-dom';

const Navbar=()=>{

return(

    <>
           <Link to='/about' >AboutUs</Link> &nbsp;
           <Link exact to='/contact'>ContactUs</Link>&nbsp;
           <Link to='/contact/myname'>ContactUs</Link>
    </>
)


}



export default Navbar;
